import { Component } from 'react';
import './App.css';
import call from './call.png';
import document from './document.png';
import homePageLogo from './homePage.png';
import medScan from './medScann.png';
import records from './reminderHistory.png';

class App extends Component{

  render(){
    return (
      <div className="App">
        <img className="home_page_logo" src={homePageLogo}/>
        <div className="container2"> 
          <div className='inner_container'>
            <div className='inner_logos_div'>
              <img className="inner_logos" src={medScan} />
            </div>
            <div className='inner_logos_div'>
              <img className="inner_logos" src={document} />
            </div>
          </div>
          <div className='inner_container'>
            <div className='inner_logos_div'>
              <img className="inner_logos" src={call} />
            </div>
            <div className='inner_logos_div'>
              <img className="inner_logos" src={r} />
            </div>
          </div>
        </div>
      </div>
    );
  }
}

export default App;
